<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<div id="map" style="height: 500px; width: 100%"></div>

<script type="text/javascript">  
function initMap() { 		
    var map = L.map('map').setView([35.5, 2.175], 3);
    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);
    var geoMarkers = L.layerGroup().addTo(map);

    var RedIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/123-red-dot.png',
    iconSize: [32, 32],
    });

    var BlueIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/22-blue-dot.png',
    iconSize: [32, 32],
    });

    var el = angular.element($('#map').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.locationWatcher = el.scope().compiledScope.$watch('MapEvents', function(newValue, oldValue) {
            geoMarkers.clearLayers();
            angular.forEach(newValue, function(event) {
                 var marker = L.marker([event.values[3], event.values[2]], {icon: RedIcon}).bindPopup(event.values[6] +" - Deaths: " + event.values[1] ).addTo(geoMarkers);

            });
        })
    });
}

if (window.locationWatcher) { window.locationWatcher(); }

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>

