%spark
import org.apache.spark.ml.clustering.KMeans

val NumberOfClusters = 500

//Create the K-Means model
val kmeans = new KMeans().setK(NumberOfClusters).setFeaturesCol("features").setPredictionCol("prediction")

//Train the K-Means model with feature vector
val model = kmeans.fit(FPVector)

//Run data set against K-Means model and assign values
val Results = model.transform(FPVector)
Results.persist()

%spark
import scala.collection.mutable.ListBuffer

//Find the number of events in each cluster
val clusterCount = model.getK

//Create iterator counter
var anomalyCount = 0;

//Create Anomaly List
val anomaly = new ListBuffer[DataFrame]()

//Count the number of events per cluster
for( a <- 0 until clusterCount) {
    val count = Results.filter("prediction = "+a.toString()).count()
    println("Cluster "+a.toString() + " count: "+count.toString()  )

    //Anomaly Detection 
    if(count == 1)
    {
      val anomalyDF = Results.filter("prediction = "+a.toString()).toDF()
      //print(anomalyString.show() ) 
      anomaly += anomalyDF
      anomalyCount+=1
   }
}

%spark 

