//Define SQL Context
val sqlContext = new org.apache.spark.sql.SQLContext(sc)

//Create a data frame from CSV File 
val df_WholeSet = sqlContext.read.format("com.databricks.spark.csv").option("header", "true").option("inferSchema", "true").load("hdfs://sandbox.hortonworks.com:8020/tmp/globalterrorismdb_0616dist.csv")

