//Clean up null values and replace them with 0 value
val df_CleanClusterData = df_ClusterData.na.fill(0)

//Transform categorical data using One Hot Encoder

//Attack Type
val indexer = new StringIndexer().setInputCol("attacktype1_txt").setOutputCol("AT_Index").fit(df_CleanClusterData)
val indexed = indexer.transform(df_CleanClusterData)

val encoder = new OneHotEncoder().setInputCol("AT_Index").setOutputCol("AT_Vec")
